enum ActionType {
    ADD_PASSWORD = 'ADD_PASSWORD',
    RESET_PASSWORD = 'RESET_PASSWORD',
    GET_USERS = 'GET_USERS',
    POST_USERS = 'POST_USERS',
    USERS_ERROR = 'USERS_ERROR',
    GET_EMPLOYEES_TIME_TODAY_START = 'GET_EMPLOYEES_TIME_TODAY_START',
    GET_EMPLOYEES_TIME_TODAY_SUCCESS = 'GET_EMPLOYEES_TIME_TODAY_SUCCESS',
    GET_EMPLOYEES_TIME_TODAY_ERROR = 'GET_EMPLOYEES_TIME_TODAY_ERROR',

    POST_EMPLOYEES_TIME_TODAY_START = 'POST_EMPLOYEES_TIME_TODAY_START',
    POST_EMPLOYEES_TIME_TODAY_SUCCESS = 'POST_EMPLOYEES_TIME_TODAY_SUCCESS',
    POST_EMPLOYEES_TIME_TODAY_ERROR = 'POST_EMPLOYEES_TIME_TODAY_ERROR',
}

export interface IAction<T> {
    type: ActionType;
    payload: T;
}


export default ActionType
